                    <g id="iXTGknCESY6ISkOpc9cZsw" class="l-group-text-16v symbol" pw:frame="16 1277 327 484" transform="translate(16 1277)">
                      <g id="iXTGknCESY6ISkOpc9cZswbw9RGsW_RmiDHQQwNkUgcQ" class="l-group-text-16v" pw:frame="0 0 327 484">
                        <text x="0" y="11" pw:baseline-offset="11" id="iXTGknCESY6ISkOpc9cZsw_RiUlumRQAGcE9BVrKGoBw" class="l-" fill="#3F9EFF" pw:frame="0 0 20 14" pw:resizing-constraints="height" font-size="10px" font-family="'PingFang SC',sans-serif" font-weight="600">命中</text>
                        <foreignObject x="0" y="60" width="327" height="14" id="iXTGknCESY6ISkOpc9cZswirnornrwS0CXu47DFHGAZA" class="l-- text" fill="#3F9EFF" pw:frame="0 60 327 14">
                          <div xmlns="http://www.w3.org/1999/xhtml" class="html-text" style="color:#3F9EFF;font-size:10px;font-family:'PingFang SC',sans-serif;line-height:14px;font-weight:600">模糊名单/风险名单                          </div>
                        </foreignObject>
                        <foreignObject x="0" y="30" width="327" height="14" id="iXTGknCESY6ISkOpc9cZswIydHuARxSjWDChheZ_1QLA" class="l- text" fill="#606266" pw:frame="0 30 327 14">
                          <div xmlns="http://www.w3.org/1999/xhtml" class="html-text" style="font-size:10px;font-family:'PingFang SC',sans-serif;line-height:14px;color:#606266">命中的意思是“存在”                          </div>
                        </foreignObject>
                        <foreignObject x="0" y="90" width="327" height="70" id="iXTGknCESY6ISkOpc9cZswpQHSsmeaTJO7JLXN8nobeg" class="l- text" fill="#606266" pw:frame="0 90 327 70">
                          <div xmlns="http://www.w3.org/1999/xhtml" class="html-text" style="font-size:10px;font-family:'PingFang SC',sans-serif;line-height:14px;color:#606266">
                            <p>借款前，放贷机构会在金融平台共享信息中查询用户是否存在不良行为记录，包括借款人填写资料与实际不符，借款人信息出现在多家小贷注册名单中等情况。</p>
                            <p>模糊名单=低风险</p>
                            <p>风险名单=中风险</p>
                          </div>
                        </foreignObject>
                        <foreignObject x="0" y="176" width="327" height="14" id="iXTGknCESY6ISkOpc9cZswD3Ueu2ZnR7icQ_P4YQ1wLg" class="l- text" fill="#3F9EFF" pw:frame="0 176 327 14">
                          <div xmlns="http://www.w3.org/1999/xhtml" class="html-text" style="color:#3F9EFF;font-size:10px;font-family:'PingFang SC',sans-serif;line-height:14px;font-weight:600">命中的原因                          </div>
                        </foreignObject>
                        <foreignObject x="0" y="206" width="327" height="28" id="iXTGknCESY6ISkOpc9cZswyjddDEadSh6ChVR50g8UvA" class="l- text" fill="#606266" pw:frame="0 206 327 28">
                          <div xmlns="http://www.w3.org/1999/xhtml" class="html-text" style="font-size:10px;font-family:'PingFang SC',sans-serif;line-height:14px;color:#606266">逾期，自己频繁申请，通话记录里面的联系人有频繁申请或者黑户，经常查询报告或者异常借款或者被商户拉黑等等                          </div>
                        </foreignObject>
                        <foreignObject x="0" y="250" width="327" height="14" id="iXTGknCESY6ISkOpc9cZswHz0sU6kqRuWC_EK4K1xtUQ" class="l- text" fill="#3F9EFF" pw:frame="0 250 327 14">
                          <div xmlns="http://www.w3.org/1999/xhtml" class="html-text" style="color:#3F9EFF;font-size:10px;font-family:'PingFang SC',sans-serif;line-height:14px;font-weight:600">消费金融公司                          </div>
                        </foreignObject>
                        <foreignObject x="0" y="280" width="327" height="42" id="iXTGknCESY6ISkOpc9cZswJMF2SDv1TXetMCN8i9R7qg" class="l- text" fill="#606266" pw:frame="0 280 327 42">
                          <div xmlns="http://www.w3.org/1999/xhtml" class="html-text" style="font-size:10px;font-family:'PingFang SC',sans-serif;line-height:14px;color:#606266">
                            <p>银行消费金融公司是指依靠银行专业背景成立的，具有消费金融牌照的公司。大多是上市公司/传统企业与银行合作成立公司的模式。</p>
                            <p>代表：捷信消费金融、马上消费金融、招联消费金融</p>
                          </div>
                        </foreignObject>
                        <foreignObject x="0" y="338" width="327" height="14" id="iXTGknCESY6ISkOpc9cZswE5MgEX6rTse0VKRTU0AzHw" class="l- text" fill="#3F9EFF" pw:frame="0 338 327 14">
                          <div xmlns="http://www.w3.org/1999/xhtml" class="html-text" style="color:#3F9EFF;font-size:10px;font-family:'PingFang SC',sans-serif;line-height:14px;font-weight:600">小额贷款公司                          </div>
                        </foreignObject>
                        <foreignObject x="0" y="426" width="327" height="14" id="iXTGknCESY6ISkOpc9cZswxpR2B9R9Sx6UL0aKW_onlw" class="l-p2p text" fill="#3F9EFF" pw:frame="0 426 327 14">
                          <div xmlns="http://www.w3.org/1999/xhtml" class="html-text" style="color:#3F9EFF;font-size:10px;font-family:'PingFang SC',sans-serif;line-height:14px;font-weight:600">P2P网贷                          </div>
                        </foreignObject>
                        <foreignObject x="0" y="368" width="327" height="42" id="iXTGknCESY6ISkOpc9cZswnJXj96OQRiK19RUh8_mLIQ" class="l- text" fill="#606266" pw:frame="0 368 327 42">
                          <div xmlns="http://www.w3.org/1999/xhtml" class="html-text" style="font-size:10px;font-family:'PingFang SC',sans-serif;line-height:14px;color:#606266">
                            <p>小额贷款公司是指有自然人、企业法人与其他社会组织投资设立，不吸收公众存款。经营小额贷款业务的有限责任公司或股份有限公司。</p>
                            <p>代表：人人贷、玖富普惠、平安普惠</p>
                          </div>
                        </foreignObject>
                        <foreignObject x="0" y="456" width="327" height="28" id="iXTGknCESY6ISkOpc9cZswRv__6ra0SQGF2FD54H5q3Q" class="l-p2p text" fill="#606266" pw:frame="0 456 327 28">
                          <div xmlns="http://www.w3.org/1999/xhtml" class="html-text" style="font-size:10px;font-family:'PingFang SC',sans-serif;line-height:14px;color:#606266">P2P网贷是指由第三方网贷平台作为中介平台，借款人在平台发放借款标，投资者进行竞标向借款人放贷的行为。                          </div>
                        </foreignObject>
                      </g>
                    </g>

                    <foreignObject x="16" y="464" width="327" height="108" id="L5tYBNDqQESk3fTwDEGQ7w" class="l-- text" fill="#2872DD" pw:frame="16 464 327 108">
                      <div xmlns="http://www.w3.org/1999/xhtml" class="html-text" style="font-size:10px;font-family:'PingFang SC',sans-serif;line-height:18px;color:#2872DD">
                        <p style="font-weight:600">有云信分数说明: </p>
                        <p style="color:#606266">“有云信”分是对匹配检测，风险扫描，不良信息，运营商信息和个人信息核查，多平台检测这六大维度进行综合分析；</p>
                        <p style="color:#606266">通过数据模型计算出的信用分数；</p>
                        <p style="color:#606266">分数仅供查询人参考；</p>
                        <p style="color:#606266">评分越高，代表贷款被拒率越高。</p>
                      </div>

                        <p>66-85/较差&nbsp;&nbsp;86-100/极差</p>
</div>                      </div>
